const Index = () => (
  <div className="body">
    <h1>topIN.com</h1>
    <style global jsx>{`
      .body {
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto,
          Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif;
        margin: 0;
        font-size: $font-size;
        -webkit-font-smoothing: antialiased;
        line-height: 1.3;
        background-color: white;
        color: #586371;
        width: 100vw;
        height: 1000vh;
      }
    `}</style>
  </div>
);

export default Index;
